import React from 'react';
import './App.css';
import UserRegistration from "./components/userRegistration/UserRegistration";

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom"

import Address from "./components/address/Address";


/*
export  default function App() {

    return (
        <div className="container-fluid">
            <nav>
                <div className="nav-wrapper center-align">
                    <a href="/" className="brand-logo">User Registration</a>
                </div>
            </nav>

            <div className="row">
                <UserRegistration/>
            </div>

            <nav>
                <div className="nav-wrapper center-align">
                    <a href="/" className="brand-logo">Address</a>
                </div>
            </nav>

            <div className="row">
                <Address />
            </div>
        </div>
    );
}*/

export default function App() {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/userReg">User Registration</Link>
                        </li>
                        <li>
                            <Link to="/address">Address</Link>
                        </li>
                    </ul>
                </nav>

                <Switch>

                    <Route path="/userReg">
                        <UserRegistration />
                    </Route>

                    <Route path="/users">
                        <Users />
                    </Route>

                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </div>
        </Router>
    )
}

function Home(){
    return(
        <h2>Home </h2>,
            <p>This is fucking home session .</p>
    )
}
function About(){
    return(
        <h2>About</h2>,
            <p>This is fucking about session .</p>
    )
}
function Users()
{
    return(
        <h2>Users</h2>,
            <p>This is fucking users session</p>
    )
}
